(25792,'g_scrl_of_ench_wolf_shirt','Scroll: Enchant Elemental Shirt','','Enchant scroll that is exclusive to Pa\'agrio\'s Shirt, Sayha\'s Shirt, Eva\'s Shirt, Maphr\'s Shirt, and the Shiny Elemental Shirt. When enchanted, increases P. Def. and M. Def. by 1. P. Def. + 3 starting from +4. Can be safely enchanted to +3 and up to a maximum of +10. From +4, basic stats (CON, MEN, STR, INT, DEX, WT) are raised in stages. Depending on the shirt type, various additional options can be applied from +4 to +10.',1,1,1,'none','consume_type_stackable'),
(25793,'etc_scroll_of_enchant_shirt_i00','Blessed Scroll: Enchant Elemental Shirt','','Enchant Scroll exclusive to Pa\'agrio, Sayha, Maphr and Eva Shirts. When enchanted, increases P. Def. and M. Def. by 1. From +3, Elemental defense increases by 3, and from +4, P. Def. Increases by 3. Can be safely enchanted up to +3 and can be enchanted up to a max of +10. Basic stats (CON, MEN, STR, INT, DEX, WIT) are gradually increased with each enchant level starting from +4. At +5, +6, +7, +8, +9, and +10, additional bonuses are also applied. If enchanting fails, the enchant value will be reset to 0.',1,1,1,'none','consume_type_stackable'),
