(28378,'bm_jewel_vital_high_lv1_lavianrose','Greater Vital Stone','','Increases Vitality Status Bonus EXP by 50% and decreases Vitality Point Consumption Speed by 15%. XP Gain increases by 10%. Can use Vital Wind skill. Effect does not stack with additional jewels of the same type. Equipping various Greater Jewels will grant additional effects.',1,1,1,'none','consume_type_normal'),
